import React from 'react';
import SearchFilter from './SearchFilter';

const App = () => {
  const data = ['Apple', 'Banana', 'Orange', 'Mango', 'Pineapple'];

  return (
    <div>
      <h1>Search Filter Example</h1>
      <SearchFilter data={data} />
    </div>
  );
};

export default App;
